import React, { useRef, useEffect } from 'react';
import PersonalCard from '../../components/personalcard'

import './membri.scss'

const Membri = props => {
    return (
        <div id="membri">
            <PersonalCard
                avatar="https://pbs.twimg.com/profile_images/1132264182425038848/OBVFF_Mw_400x400.png"
                role="Președintele Departamentului de Jmekerime"
                name="Serban Cercelescu"
                institution="Universitatea din Oxford"
            />
            <PersonalCard
                avatar="https://pbs.twimg.com/profile_images/1132264182425038848/OBVFF_Mw_400x400.png"
                role="Președintele Departamentului de Jmekerime"
                name="Serban Cercelescu"
                institution="Universitatea din Oxford"
            />
        </div>
    );
};

export default Membri;
